import React from 'react';
import { Link } from 'react-router-dom';
import './styles/LandingPage.css';

function LandingPage() {
    return (
      <div className="container-fluid landing-page border-box">
        <div className="row h-100">
          {/* Left side with Welcome text and buttons */}
          <div className="col-md-6 d-flex flex-column align-items-center justify-content-center text-section">
            <h1 className="welcome-text">Welcome to Edumentor</h1>
            <p className="select-role">Select your role</p>
            <div className="role-buttons">
              <button className="btn btn-dark role-btn">Student</button>
              <button className="btn btn-dark role-btn">Mentor</button>
            </div>
          </div>
  
          {/* Right side with Image */}
          <div className="col-md-6 d-flex align-items-center justify-content-center image-section">
            <img src="student-mentor.png" alt="Mentoring" className="landing-image" />
          </div>
        </div>
      </div>
    );
  }
  
  export default LandingPage;
